import './App.css';
import Navbar from './Components/Navbar';
import Home from './Pages/Home';
import { Routes, Route, BrowserRouter } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Home />}></Route>
      </Routes>
      <Navbar />
    </div>
  );
}

export default App;
